INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 4, 24015, 0.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 1, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 1, 4, 24016, 4.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 2, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 4, 24017, 0.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 3, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 2, 1, 24018, 5.2, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 4, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 6, 5, 24019, 4.2, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 5, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 2, 24020, 0.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 6, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6, 1, 24021, 6.4, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 7, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 2, 24022, 0.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 8, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 3, 6, 24023, 10.08, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 9, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 2, 1, 24024, 5.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 10, 10021, 0.0);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("2019/07/31 12:00:00", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 2, 24025, 0.0, 110501, 0.0, 24, "2030/12/17 14:59:59", "カオリ（サマー）", 11, 10021, 0.0);
